import React from 'react';
import '../../App.css';
import './footer.css';

function Footer() {
  return (
    <footer id="footer">
  <div className="container">
    <div className="footer_content">
      <div class="left">
        Privacy Policy
        Terms of Use
      </div>
      <div class="right">
        <span>&copy; 2023 IST.KUMU.com</span>
      </div>
    </div>
  </div>
</footer>

  );
}

export default Footer
